import Stage from './Stage.js';
import Car from './Car.js';
import Background from './Background.js';

const Right = (props) => {
  return(
    <>
      <Stage/>
      <Car position={[0, -1, 0]} rotation={[0, -1.5, 0]}/>
      <Background/>
    </>
  );
}

export default Right;
